import React, {  } from 'react';
import styles from './Branch.module.css';
import cn from 'classnames';
import DefaultIcon from './icons/restaurant.svg';
import { Tree } from '../';
import { Button } from '../../elements';
import './Tree.css';
export const Branch = (props) => {
    const { category_id, parent_id, name, products, product_id, url, active=false, expanded } = props;
    return (
        <li className={`${styles.branch} list-group-item`}>
            <div className={styles.information}>
                <div className="tree__block">
                    {(!product_id) ? 
                        <div className="tree__block-open">
                            <Button icon='close' opacity={true} />
                            <button type="button" className={cn(styles.button, {
                                [styles.button_close]: true,
                                [styles.button_open]: false,
                                [styles.button_casper]: products && !products.length
                            })}></button>
                        </div>
                    : null}
                    <img className={styles.image} src={url || DefaultIcon} alt={name} />
                    <p className={styles.name}>{name}</p>
                </div> 
                <ul className={styles.buttons}>
                    <li className="tree__category-button">
                        <button type="button" className="tree__button position"></button>
                    </li>
                    <li className="tree__category-button">
                        <button type="button" className="tree__button tree__category-edit"></button>
                    </li>
                    <li className="tree__category-button">
                        <button type="button" className="tree__button tree__category-delete"></button>
                    </li>
                    {(!product_id) ?
                        <li className="tree__category-button">
                            <button type="button" className="tree__button tree__category-insert"></button>
                        </li> : null
                    }
                    <li className="tree__category-button click-element">
                        <label className="switch">
                            <input className="click-element" type="checkbox" checked={active} />
                            <span className="slider round"></span>
                        </label>
                    </li>
                </ul>
            </div>
            {(products && products.length) ?
                <Tree tree={products} view={expanded ? 'open' : ''} /> : null
                // <ul className="tree__sub-list list-group sTree2"></ul> : null
            }
        </li>
    )
}
